  input: '"TEXT","F3A","C00271171","This report is being amended in response to FEC
    correspondence dated 7/27/04.  For all contributions received for the general
    election, a check is being written to refund the full amount of the general election
    contributions to the respective donors.  These checks were written on 8/19/04
    and will be reported as refunds on the October 2004 quarterly report.  Copies
    of all refund checks are being mailed to the FEC under separate cover.  The list
    attached to the FEC correspondence regarding excessive and/or prohibited contributions
    only lists federal candidates.  As such, these contributions are permitted and
    no further action is necessary.  However, disbursements were made to two state
    candidates on this report.  We are requesting a refund from one of the prohibited
    parties and are sending a copy of this letter to the FEC under separate cover.  We
    have already received the refund from the other prohibited party.  This refund
    will be reported on the October 2004 quarterly report.  Regarding the refund to
    Mark Wallach, Trustee, on Schedule B, the $4800 was a refund for contributions
    made by William P. Brosnahan, Jr. over several years.  William Brosnahan has filed
    for Chapter 7 bankruptcy.  The trustee, Mark Wallach, requested a refund of all
    contributions made by William Brosnahan from the time he was deemed insolvent
    since such contributions were considered transfers subject to the trustees avoidance
    powers.  The $4800 was refunded as part of a settlement agreement."'
